export const colors = {
    blue: '#1D428A',
    red: '#B8231F',
    green: '#077821',
    white: '#ffffff',
    grey: '#f0f0f0',
    black: '#000000',
};

export const setColors = {
    title: colors.blue, // Color of the titles in the cards
    text: colors.black, // General text
    navBarcolors: colors.black, // Text in the banner including the title
    cardBackground: colors.white, // Card backgrounds
    generalBackground: colors.white, // The whole page background
    navBarBackground: colors.blue, // Navbar background

};
